import "./cardsFeatured.css";

const FeaturedCard = ({imageFeatured, title, subjectFeatured }) => {
    return(
        <article>
            <header>
                <h4>{title}</h4>
            </header>
            <section>
                <figure>
                    <img src={imageFeatured} alt=""/>
                    
                </figure>
            </section>
        </article>
    )
}

export default FeaturedCard;
